import queue

class node:
    def __init__(self, v, t):
        self.v = v
        self.t = t

def BFS(num):
    c = [1, -1, 10, -10, 100, -100]
    q = queue.Queue()
    new1 = node(10, 0)
    q.put(new1)
    while not q.empty():
        head = q.get()
        if head.v == num:
                return head.t
        for i in range(8):
            if i < 6:
                if head.v + c[i] < 10 or head.v + c[i] > 300:
                    continue
            if i == 6 and head.v == 300:
                continue
            if i == 7 and head.v == 10:
                continue
            end = node(head.v, head.t)
            end.t += 1
            if 0 <= i < 6:
                end.v = head.v + c[i]
            elif i == 6:
                end.v = 300
            elif i == 7:
                end.v = 10
            q.put(end)


if __name__ == '__main__':
    n = int(input())
    a = [[0 for i in range(4)]for i in range(n)]
    for i in range(n):
        a[i] = list(map(int, input().split()))
    for i in range(n):
        count = 0
        for j in range(4):
            count += BFS(a[i][j])
        print(count)

from collections import deque

class node:
    def __init__(self, v, t):
        self.v = v
        self.t = t


def BFS(num):
    c = [1, -1, 10, -10, 100, -100]
    q = deque()
    new1 = node(10, 0)
    q.append(new1)
    while q:
        head = q.popleft()
        if head.v == num:
            return head.t
        for i in range(8):
            if i < 6:
                if head.v + c[i] < 10 or head.v + c[i] > 300:
                    continue
            if i == 6 and head.v == 300:
                continue
            if i == 7 and head.v == 10:
                continue
            end = node(head.v, head.t)
            end.t += 1
            if 0 <= i < 6:
                end.v = head.v + c[i]
            elif i == 6:
                end.v = 300
            elif i == 7:
                end.v = 10
            q.append(end)


if __name__ == '__main__':
    n = int(input())
    a = [[0 for i in range(4)] for i in range(n)]
    for i in range(n):
        a[i] = list(map(int, input().split()))
    for i in range(n):
        count = 0
        for j in range(4):
            count += BFS(a[i][j])
        print(count)

from collections import deque
from functools import lru_cache


@lru_cache(None)
def bfs(target):
    res = 0
    dic = [-1,1,-100,100,-10,10]
    q = deque()
    q.append((10,0))
    q.append((300,1))
    mp = set()
    # 从u->10的最小步数
    while len(q):
        u ,c = q.popleft()
        if u==target:
            res = c
            break
        if u in mp:
            continue
        mp.add(u)
        for d in dic:
            tu = u+d
            if 300>=tu>=10:
                q.append((tu,c+1))
    return res
def solve():
    a = [bfs(int(x)) for x in input().split()]
    print(sum(a))

t = int(input())
for _ in range(t):
    solve()

