    q = deque()
    q.append((10,0))
    q.append((300,1))
    mp = set()
    # 从10->target的最小步数
    while len(q):
        u ,c = q.popleft()
        if u==target:
            res = c
            break
        if u in mp:
            continue
        mp.add(u)
        for d in dic:
            tu = u+d
            if 300>=tu>=10:
                q.append((tu,c+1))
    return res
